import React from "react";

function Transaction(props) {

    return (
        <div className={`Transaction ${props.type === "income" ? "income-txn" : "expense-txn"}`}>
            <p>{props.type}</p>
            <p>{props.description}</p>
            <p>{props.date}</p>
            <p>{props.category}</p>
        </div>
    );
};

export default Transaction;
